import "./TopBar.css";

function TopBarButtons() {
  return (
    <div className="Nav" style={Hamburger()}>
      <a href="index.html" id="Logo">
        Logo
      </a>
      <div id="NavMiddle">
        <a id="BlogBtn">Blog</a>
        <a id="Home" href="index.html">
          Home
        </a>
        <a id="Projects">Projects</a>
      </div>
      <a href="socials.html" id="Socials">
        Socials
      </a>
    </div>
  );
}

export default function NavBar() {
  var width = window.visualViewport.width;
  if (width <= 615) {
    return function Hamburger() {
      return <div className="Nav" style={Hamburger()}></div>;
    }
  }
}
